/* eslint-disable no-unused-vars */
import React from "react";
import "./DisplayData.css"
import { Container, Row, Col, Card,Button} from "react-bootstrap";

const DisplayData = (props) => {
  const { name, Age, img, Role, Salary } = props.children;
console.log(props.children)
//    const totalTems = props.children.Team.map(tem => <p>{tem}</p>)

  return (
    <div>
        <div className="DisplayData">
        <Container>
        <Row>
          <Col md={4}>
            <Card>
              <Card.Img variant="top" src={img} />
              <Card.Body>
                <Card.Title>Name : {name}</Card.Title>
                <Card.Title>Age : {Age}</Card.Title>
                <Card.Title>Role : {Role}</Card.Title>
                <Card.Title>Salary : {Salary}</Card.Title>

                <Button variant="primary">Added My Team</Button>
              </Card.Body>
            </Card>
          </Col>
        </Row>
      </Container>

      <Container>
          <Row>
              <h1>My team</h1>
          </Row>
      </Container>
        </div>

    </div>
  );
};

export default DisplayData;
